    color: #333;
  }

  &--small {
    width: auto;
    padding: 0.7rem 0.5rem;
  }
  &--medium {
    width: 15rem;
  }
  &--large {
    width: 23rem;
  }
  &--full {
    width: 100%;
  }

  &__icon {
    &--left {
      margin-right: 0.5rem;

      &.disabled {
        display: none;
      }
    }
  }
}

